
public class Multiplication {

	public static void main(String[] args) {
		
		// TODO Auto-generated method stub
		int N = 9;
		for (int i = 1; i <= 10; i++) {
            // printing the N*i,ie ith multiple of N.
            System.out.println(N + " * " + i + " = " + N * i);

                       

	}

}
}
